<div class="container-fluid px-4 pt-4">
  @if ($profile_modal)
    <div class="modal" tabindex="-1" style="display:block;">
      <div class="modal-dialog modal-dialog-scrollable modal-lg modal-center">
        <div class="modal-content bg-secondary">
          <div class="modal-header">
            <button class="close btn btn-secondary" type="button" wire:click="close_profile">
              <span>&times;</span>
            </button>
          </div>
          <div class="modal-body">
            @livewire('app.card.profile', ['id' => write($profile->id)])
          </div>
          <div class="modal-footer">
            <button class="btn btn-secondary" type="button" wire:click="close_profile">{{ _app('close') }}</button>
          </div>
        </div>
      </div>
    </div>
  @endif
  <div class="d-flex align-items-center rounded-top mt-2 p-4" style="justify-content: space-between;">
    <h4>People you may know</h4>
    <div class="card-header-action">
      {{-- <a class="btn btn-danger btn-icon icon-right" href="#">View All <i class="bi bi-chevron-right"></i></a> --}}
    </div>
  </div>
  <div class="row align-items-center">
    @foreach ($people as $user)
      <div class="col align-items-center text-center">
        <hr>
        <img class="rounded-circle" src="{{ $user->profile_photo_url }}" alt="image"
          style="width: 120px; height: 120px;" loading="lazy">
        <span class="btn btn-sm start-100 translate-middle badge rounded-pill bg-primary top-0"
          wire:click='view_profile("{{ write($user->id) }}")'>
          View
        </span>
        <div class="card-details align-items-center text-center">

          <div class="text-white">{{ $user->name }}</div>
          <div class="text-muted">{{ $user->client->name }}</div>
          <hr>
          <div class="ca-cta">
            <button class="liquid_button" wire:click='toggle_follow("{{ write($user->id) }}")'>
              <p>Followers
                {{ $user->followers->count() }}</p>
              <div class="liquid">
                <span style="--i:0"><span></span></span>
                <span style="--i:1"><span></span></span>
                <span style="--i:2"><span></span></span>
                <span style="--i:3"><span></span></span>
                <span style="--i:4"><span></span></span>
                <span style="--i:5"><span></span></span>
                <span style="--i:6"><span></span></span>
